(function(){$.datetimepicker.setLocale("ru");window.DatetimeInput=function(){DatetimeInput.init=function(container){if(container==null){container=$("body")}return $("input.datepicker",container).each(function(index,input){return new DatetimeInput(input)})};function DatetimeInput(input){this._input=$(input);this._input.datetimepicker({timepicker:false,format:"d.m.Y"})}return DatetimeInput}()}).call(this);